import './SimpleLineChart.css';
import mock from '../../data/mock.json'
import { AreaChart, Area, LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';


const CustomTooltip = ({ active, payload }) => {
    if (active && payload && payload.length) {
        return (
            <div className="lineChart-tooltip">
                <p className="tooltip-label">{`${payload[0].value} min`}</p>
            </div>
        );
    }
    return null;
};

const renderLegend = () => {
    return <p>Dur√©e moyenne des sessions</p>
}

const CustomTick = ({ index, x, y }) => {
    switch (index) {
        case 0:
            return (
                <text x={x - 5} y={y + 10}>
                    L
                </text>
            );
        case 1:
            return (
                <text x={x - 5} y={y + 10}>
                    M
                </text>
            );
        case 2:
            return (
                <text x={x - 5} y={y + 10}>
                    M
                </text>
            );
        case 3:
            return (
                <text x={x - 5} y={y + 10}>
                    J
                </text>
            );
        case 4:
            return (
                <text x={x - 5} y={y + 10}>
                    V
                </text>
            );
        case 5:
            return (
                <text x={x - 5} y={y + 10}>
                    S
                </text>
            );
        case 6:
            return (
                <text x={x - 5} y={y + 10}>
                    D
                </text>
            );
        default:
            break;
    }
};

function SimpleLineChart() {
    return (

        <div className="line-chart">
            <ResponsiveContainer>
                {/* Line chart         */}
                {/* <LineChartJS
            data={formattedData}
            margin={{ top: 5, right: 30, left: 30, bottom: 5 }}
          >
            <XAxis
              dataKey="name"
              axisLine={false}
              tickLine={false}
              stroke="var(--text-color-quaternary)"
            />
            <YAxis dataKey="min" hide />
  
            <Line
              type="monotone"
              name="min"
              dataKey="min"
              stroke="var(--text-color-quaternary)"
              strokeWidth={2}
              dot={false}
            />
            <Tooltip
              animationEasing="ease-out"
              content={<LineCustomTooltip payload={formattedData} />}
              wrapperStyle={{ outline: "none" }}
            />
            <Legend align="left" verticalAlign="top" iconType="none" />
          </LineChartJS> */}

                <AreaChart
                    data={mock.data.averageSessions}
                    margin={{ top: 60, right: 20, left: 20, bottom: 5 }}
                >
                    <defs>
                        <linearGradient id="colorMin" x1="0" y1="0" x2="0" y2="1">
                            <stop
                                offset="5%"
                                stopColor="var(--bg-color-tertiary)"
                                stopOpacity={0.8}
                            />
                            <stop
                                offset="95%"
                                stopColor="var(--color-tertiary)"
                                stopOpacity={0}
                            />
                        </linearGradient>
                    </defs>
                    <XAxis
                        dataKey="name"
                        axisLine={false}
                        tickLine={false}
                        stroke="var(--color-quaternary)"
                    // padding={{ left: 0, right: 0 }}
                    />
                    <YAxis dataKey="min" hide />
                    <Area
                        type="monotone"
                        dataKey="min"
                        stroke="var(--color-quaternary)"
                        strokeWidth={2}
                        fillOpacity={1}
                        fill="url(#colorMin)"
                    />

                    <Tooltip
                        animationEasing="ease-out"
                        content={<LineCustomTooltip payload={formattedData} />}
                        wrapperStyle={{ outline: "none" }}
                    />
                </AreaChart>
            </ResponsiveContainer>
        </div>

        // <div id="simpleBarChartContainer">
        //     <ResponsiveContainer width="100%" aspect={1} id="simpleBarChart">
        //         <LineChart width={300} height={100} data={mock.data.averageSessions}>
        //             <Legend content={renderLegend} align='right' />
        //             <Line type="monotone" dataKey="sessionLength" stroke="#8884d8" strokeWidth={2} />
        //             <XAxis dataKey="day" tick={<CustomTick />} tickLine={false} axisLine={false} />
        //             <Tooltip content={<CustomTooltip />} position={{ y: 0 }} />
        //         </LineChart>
        //     </ResponsiveContainer>
        // </div>

    );
}

export default SimpleLineChart;
